import React from 'react'
import { Menu } from 'semantic-ui-react';

const NavBar = () => {
    return (
        <div>
            <Menu fixed="top" inverted>
                <Menu.Item name='home'/>
                <Menu.Item name='messages'/>
                <Menu.Item name='friends'/>
            </Menu>
        </div>
    )
}

export default NavBar
